import React from 'react'
import {
  ChakraProvider,
  Text,
  Box,
  Container
} from '@chakra-ui/react'
import Fonts from './components/fonts'
import theme from './theme/theme'
import './App.css';
import Header from './components/Header'

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Fonts />
      <Container maxW="container.lg">
        <Header />
      </Container>
    </ChakraProvider>
  );
}

export default App;
